B.a7T=new A.lp("ambience_ocean","Zvuky oce\xe1nu","Zvuky oce\xe1nu","assets/audio/ambience_ocean.mp3","assets/images/tile_ambience.png","Nahr\xe1vka zachycuje atmosf\xe9ru a zvuky oce\xe1nu, a p\u0159enese v\xe1s do prost\u0159ed\xed pln\xe9ho \u0161um\u011bn\xed vln, kter\xe9 se val\xed na pl\xe1\u017e. P\u0159i poslechu t\xe9to nahr\xe1vky m\u016f\u017eete sly\u0161et relaxa\u010dn\xed zvuky mo\u0159sk\xe9ho v\u011btru, bubl\xe1n\xed vody","assets/audio/ambience.png")
