B.a7W=new A.lp("afirmace_ranni","Rann\xed","Rann\xed Afirmace","assets/audio/afirmace_ranni.mp3","assets/images/tile_afirmace.png","Nastartuj sv\u016fj den, tyto rann\xed afirmace ti pom\u016f\u017eou nakopnout tv\u016fj den. Tyto afirmace ti pomohou udr\u017eet cel\xfd den pozornost na tom, co je d\u016fle\u017eit\xe9 a tak\xe9 - d\xedky t\u011bmto afirmac\xedm za\u017eije\u0161 z\xe1zraky doslova na po\u010dk\xe1n\xed. Tvoje p\u0159\xe1n\xed se budou plnit lusknut\xedm prstu.","assets/audio/afirmace.png")
B.a7X=new A.lp("meditace_prani","P\u0159\xe1n\xed","Meditace pro p\u0159\xe1n\xed","assets/audio/meditace_prani.mp3","assets/images/tile_meditace.png","Tato vizualizace s prvky meditace pom\xe1h\xe1 k nastaven\xed mysli na z\xedsk\xe1n\xed toho, co v \u017eivot\u011b chceme. Imaginace s relakcac\xed a uvoln\u011bn\xedm m\xe1 jedny z nejv\u011bt\u0161\xedch a nejv\xfdznamn\u011bj\u0161\xedch \xfa\u010dink\u016f a vliv\u016f na to, co si p\u0159ejeme i na manifestaci.","assets/audio/meditace.png")
