B.a7Z=new A.lp("meditace_vecerni","Ve\u010dern\xed","Ve\u010dern\xed meditace","assets/audio/meditace_vecerni.mp3","assets/images/tile_meditace.png","Tato n\xe1dhern\xe1 meditace p\u0159ed span\xedm v\xe1m pom\u016f\u017ee nal\xe9zt klid, nechat j\xedt v\u0161echny ud\xe1losti dne a pom\u016f\u017ee p\u0159ipravit se na nadch\xe1zej\xedc\xed r\xe1no. Meditace p\u0159ed span\xedm je \xfa\u017easn\xe1 v\u011bc na zklidn\u011bn\xed mysli, du\u0161e i t\u011bla.","assets/audio/meditace.png")
